import routeMain from "./routes";

const SearchPage = () => {
    


    return ( 
        <div className='container'>
            <form className="Search__inner">
                <input className="input" placeholder="example: animals"/>
                <button className="btn" type="submit">Поиск</button>
            </form>
        </div>
        
        
    )
}



export {routeMain};

export default SearchPage;
